/**
 * Evaluate a simple arithmetic expression consisting of two operands and an operator.
 * Supports +, -, *, / and floating point numbers.
 * Returns a string representation of the result or throws an Error for invalid ops.
 *
 * @param {string} expr - Expression like "12+3.4"
 * @returns {string}
 */
export function evaluateExpression(expr) {
  const match = expr.match(/^\s*([-+]?[0-9]*\.?[0-9]+)\s*([+\-*/])\s*([-+]?[0-9]*\.?[0-9]+)\s*$/);
  if (!match) {
    throw new Error('Invalid expression');
  }
  const [, left, operator, right] = match;
  const a = parseFloat(left);
  const b = parseFloat(right);
  let result;
  switch (operator) {
    case '+':
      result = a + b;
      break;
    case '-':
      result = a - b;
      break;
    case '*':
      result = a * b;
      break;
    case '/':
      if (b === 0) {
        throw new Error('Division by zero');
      }
      result = a / b;
      break;
    default:
      throw new Error('Unsupported operator');
  }
  // Limit to 12 significant digits to avoid floating‑point noise
  return Number(result.toPrecision(12)).toString();
}

/**
 * Calculator UI controller.
 */
class CalculatorUI {
  constructor() {
    this.display = document.getElementById('display');
    this.current = '';
    this.previous = '';
    this.operator = null;
    this.bindEvents();
  }

  bindEvents() {
    document.querySelectorAll('.btn').forEach(btn => {
      btn.addEventListener('click', () => this.handleInput(btn.dataset.key));
    });
    document.addEventListener('keydown', e => {
      const key = e.key;
      if (/[0-9.]/.test(key)) this.handleInput(key);
      else if (['+', '-', '*', '/'].includes(key)) this.handleInput(key);
      else if (key === 'Enter') this.handleInput('Enter');
      else if (key === 'c' || key === 'C') this.handleInput('c');
    });
  }

  handleInput(key) {
    if (key >= '0' && key <= '9' || key === '.') {
      this.appendNumber(key);
    } else if (['+', '-', '*', '/'].includes(key)) {
      this.chooseOperator(key);
    } else if (key === 'Enter') {
      this.compute();
    } else if (key === 'c') {
      this.clear();
    }
    this.updateDisplay();
  }

  appendNumber(num) {
    // Prevent multiple decimals
    if (num === '.' && this.current.includes('.')) return;
    this.current = this.current + num;
  }

  chooseOperator(op) {
    if (this.current === '' && this.previous !== '') {
      this.operator = op; // change operator before entering new number
      return;
    }
    if (this.current === '') return;
    if (this.previous !== '') {
      this.compute();
    }
    this.operator = op;
    this.previous = this.current;
    this.current = '';
  }

  compute() {
    if (this.operator === null || this.current === '' || this.previous === '') return;
    const expr = `${this.previous}${this.operator}${this.current}`;
    try {
      const result = evaluateExpression(expr);
      this.current = result;
    } catch (e) {
      this.current = 'Error';
    }
    this.operator = null;
    this.previous = '';
  }

  clear() {
    this.current = '';
    this.previous = '';
    this.operator = null;
  }

  updateDisplay() {
    this.display.textContent = this.current || this.previous || '0';
  }
}

// Initialize when DOM is ready
window.addEventListener('DOMContentLoaded', () => {
  new CalculatorUI();
});
