 * Simple Calculator logic.
 * Exposes a Calculator class for unit testing and wires UI interactions on DOM load.
 */

export class Calculator {
  /**
   * @param {HTMLElement} displayEl Element that shows the current value/result.
   */
  constructor(displayEl) {
    this.displayEl = displayEl;
    this.reset();
  }

  /** Reset calculator state */
  reset() {
    this.current = '';
    this.operator = null;
    this.previous = null;
    this.resultDisplayed = false;
    this._updateDisplay('0');
  }

  /** Handle a key/button press */
  /** @param {string} key */
  input(key) {
    if (key >= '0' && key <= '9') {
      this._handleDigit(key);
    } else if (key === '.') {
      this._handleDecimal();
    } else if (['+', '-', '*', '/'].includes(key)) {
      this._handleOperator(key);
    } else if (key === 'Enter') {
      this._calculate();
    } else if (key === 'Escape') {
      this.reset();
    }
  }

  /** @private */
  _handleDigit(digit) {
    if (this.resultDisplayed) {
      this.current = digit;
      this.resultDisplayed = false;
    } else {
      this.current = this.current === '0' ? digit : this.current + digit;
    }
    this._updateDisplay(this.current);
  }

  /** @private */
  _handleDecimal() {
    if (this.resultDisplayed) {
      this.current = '0.';
      this.resultDisplayed = false;
    } else if (!this.current.includes('.')) {
      this.current = this.current === '' ? '0.' : this.current + '.';
    }
    this._updateDisplay(this.current);
  }

  /** @private */
  _handleOperator(op) {
    if (this.current === '' && this.previous === null) {
      // No operand yet – ignore.
      return;
    }
    if (this.previous !== null && this.current !== '') {
      this._calculate();
    }
    this.operator = op;
    this.previous = parseFloat(this.current);
    this.current = '';
  }

  /** @private */
  _calculate() {
    if (this.operator === null || this.current === '' || this.previous === null) {
      return;
    }
    const a = this.previous;
    const b = parseFloat(this.current);
    let result;
    switch (this.operator) {
      case '+':
        result = a + b;
        break;
      case '-':
        result = a - b;
        break;
      case '*':
        result = a * b;
        break;
      case '/':
        if (b === 0) {
          this._updateDisplay('Error');
          this.reset();
          return;
        }
        result = a / b;
        break;
      default:
        return;
    }
    // Round to avoid floating point noise (up to 12 decimal places)
    result = Number.isInteger(result) ? result : parseFloat(result.toFixed(12));
    this._updateDisplay(String(result));
    this.current = String(result);
    this.previous = null;
    this.operator = null;
    this.resultDisplayed = true;
  }

  /** @private */
  _updateDisplay(text) {
    this.displayEl.textContent = text;
  }

  /** Get current display text (useful for tests) */
  getDisplay() {
    return this.displayEl.textContent;
  }
}

